import React,{useEffect, useState} from 'react'
function App(){
  const[backendData, setBackendData]= useState([{}])
  useEffect(()=>{
    fetch("/api").then(
      response=>response.json()
    ).then(
      data=>{
        setBackendData(data)
      }
    )
  },[])

  return(
    <div>
      {backendData.length === 0 ? (
        <p>Loading...</p>
      ) : (
        backendData.map((post) => (
          <div key={post.id}>
            <h3>{post.title}</h3>
            <p>{post.body}</p>
          </div>
        ))
      )}
    </div>
  )
}
export default App
